import { useNavigate } from "react-router-dom";
import { useContext, useEffect } from "react";


export const Dashboard = () => {
  useEffect(() => {
    if (!localStorage["token"]) {
      return nav("/login");
    }
  });
  return (
    <>
      <div>Dashboard</div>
    </>
  );
};
